import 'react-native-gesture-handler';
import React from 'react';
import { View, StatusBar } from 'react-native';

import Routes from './routes';

import { NavigationContainer } from '@react-navigation/native';

const App: React.FC = () => (
  <NavigationContainer>
  <StatusBar barStyle="light-content" backgroundColor="#126DE8"/>
<View style={{ flex:1, backgroundColor:"#126DE8"}}>
<Routes />
</ View>
</NavigationContainer>
);
export default App;
